import React from "react";
import './Header.css';
import { MainButton } from "./MainButton";
import { TopActiveButton } from "./TopActiveButton";

export const Header = (props) => {
    return (
        <div className='origin'>
            <h1 className='name-colour'>Header</h1>

            <ui>
                <li>
                    <MainButton/>
                </li>
                <li>
                    <TopActiveButton/>
                </li>
                <li>
                        <button className="top-pass-button">Button 51</button>
                </li>
            </ui>
        </div>
    )
}
